import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import React from 'react';
import LogIn from './LogIn';
import App from './App';

class Home extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            name: ''
        }
    }
    
    setName = (name) => {
        this.setState({
            name: name
        })
    }
    
    render(){
        return (
            <Router>
                <Switch> 
                    <Route exact path='/'>
                        <LogIn setName = {this.setName}/>
                    </Route>
                    <Route exact path='/App'>
                        <App name = {this.state.name}/>
                    </Route>
                </Switch>
            </Router>
        )    
    }
}
export default Home;
